  useEffect(()=>{
    axios.get("").then((response)=>{
      setListOfUsers(response.data)
    })
  },[])

  return (
    <div className="App">
    {
      listUsers.map((value, key)=>{ return 
        <div>
          {value.name}
        </div>
      })
    }
    </div>
  );
}

export default App;
